public class InnerDatastoreDatastoreStorageFactory(Action<Humidifier.IoTAnalytics.DatastoreTypes.DatastoreStorage> factoryAction = null) : SubResourceFactory<Humidifier.IoTAnalytics.DatastoreTypes.DatastoreStorage>
{

    internal InnerDatastoreCustomerManagedS3Factory CustomerManagedS3Factory { get; set; }

    internal InnerDatastoreIotSiteWiseMultiLayerStorageFactory IotSiteWiseMultiLayerStorageFactory { get; set; }

    protected override Humidifier.IoTAnalytics.DatastoreTypes.DatastoreStorage Create()
    {
        var datastoreStorageResult = CreateDatastoreStorage();
        factoryAction?.Invoke(datastoreStorageResult);

        return datastoreStorageResult;
    }

    private Humidifier.IoTAnalytics.DatastoreTypes.DatastoreStorage CreateDatastoreStorage()
    {
        var datastoreStorageResult = new Humidifier.IoTAnalytics.DatastoreTypes.DatastoreStorage();

        return datastoreStorageResult;
    }
    public override void CreateChildren(Humidifier.IoTAnalytics.DatastoreTypes.DatastoreStorage result)
    {
        base.CreateChildren(result);

        result.CustomerManagedS3 ??= CustomerManagedS3Factory?.Build();
        result.IotSiteWiseMultiLayerStorage ??= IotSiteWiseMultiLayerStorageFactory?.Build();
    }

} // End Of Class

